function gerarInformeEncerrContratualPorNaoReneg(data) {

    var config = {
        pageSize: "A4",
        pageOrientation: "portrait",
        // pageOrientation: 'landscape',
        title: "InformeEncerrContratualPorNaoReneg",
    };

    sedPdfExporter.normalizeConfig(config);

    config.codigoUnidadeGestora = data[0].unidadeGestora.codigoUnidadeGestora != undefined ? data[0].unidadeGestora.codigoUnidadeGestora : "";
    config.nomeUnidadeGestora = data[0].unidadeGestora.nomeUnidadeGestora != undefined ? data[0].unidadeGestora.nomeUnidadeGestora : "";
    config.NmUnidGest = data[0].unidadeGestora.codigoUnidadeGestora != undefined ? data[0].unidadeGestora.codigoUnidadeGestora : "";
    config.descricaoEnderecoNumero = data[0].unidadeGestora.descricaoEnderecoNumero != undefined ? data[0].unidadeGestora.descricaoEnderecoNumero : "";
    config.descricaoMunicipio = data[0].unidadeGestora.descricaoMunicipio != undefined && data[0].unidadeGestora.descricaoMunicipio != "" ? titleize(data[0].unidadeGestora.descricaoMunicipio.toLowerCase()) : "São Paulo";
    config.numeroProcesso = data[0].processo.numeroProcesso != undefined ? data[0].processo.numeroProcesso : "";
    config.NrContrato = data[0].numeroContrato != undefined ? data[0].numeroContrato : "";
    config.NmCpfCgcCredor = data[0].nomeCredor != undefined ? data[0].nomeCredor : "";
    config.NrCpfCgcCredor = data[0].numeroCpfCnpj != undefined ? data[0].numeroCpfCnpj.replace(/^(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/, "$1.$2.$3/$4-$5") : "";
    config.dsAssunto = data[0].assuntoPlanejado.descricaoAssuntoPlanejado != undefined ? data[0].assuntoPlanejado.descricaoAssuntoPlanejado : "";
    config.DsClausulaContrato = data[0].clausulaContrato != undefined ? data[0].clausulaContrato : "";
    config.DtReajustemes = data[0].dataBaseReajuste != undefined ? dataAtualFormatadames(data[0].dataBaseReajuste) : "";
    config.DtReajusteano = data[0].dataBaseReajuste != undefined ? dataAtualFormatadaano(data[0].dataBaseReajuste) : "";
    config.DtReajuste = data[0].dataBaseReajuste != undefined ? dataAtualFormatada(data[0].dataBaseReajuste) : "";
    config.NrPercentual = data[0].percentualReajuste != undefined ? data[0].percentualReajuste + '%' : "";
    config.DsFolhaCadTerc = data[0].folhaCadTerc != undefined ? data[0].folhaCadTerc : "";
    config.IdPeriodoContrato = data[0].idPeriodoContrato != undefined ? data[0].idPeriodoContrato : "";
    config.DsUnidadeContratada = data[0].descricaoUnidadeContratada != undefined ? data[0].descricaoUnidadeContratada : "";
    config.VLReajuste = data[0].valorReajuste != undefined ? data[0].valorReajuste.toFixed(2).replace(".", ",").replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1.") : "";
    config.VLReajustado = data[0].valorReajustado != undefined ? data[0].valorReajustado.toFixed(2).replace(".", ",").replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1.") : "";
    config.descricaoObjeto = data[0].descricaoObjeto != undefined ? data[0].descricaoObjeto : "";
    config.dataVigenciaIni = data[0].dataVigenciaIni != undefined ? dataAtualFormatada(data[0].dataVigenciaIni) : "";
    config.dataVigenciaFim = data[0].dataVigenciaFim != undefined ? dataAtualFormatada(data[0].dataVigenciaFim) : "";
    config.nomeGestor = data[0].nomeGestor != undefined ? titleize(data[0].nomeGestor) : "";
    config.dataImpressao = data[0].dataImpressao != undefined ? dataAtualFormatada(data[0].dataImpressao) : "";
    config.DtImpressaodia = data[0].dataImpressao != undefined ? dataAtualFormatadadia(data[0].dataImpressao) : "";
    config.DtImpressaomes = data[0].dataImpressao != undefined ? dataAtualFormatadames(data[0].dataImpressao) : "";
    config.DtImpressaonomemes = data[0].dataImpressao != undefined ? dataAtualFormatadanomemes(data[0].dataImpressao) : "";
    config.DtImpressaoano = data[0].dataImpressao != undefined ? dataAtualFormatadaano(data[0].dataImpressao) : "";
    config.nrFolha = data[0].nrFolha != undefined ? data[0].nrFolha : "";
    config.NrFolhaSolicitaMCRenegociacao = data[0].NrFolhaSolicitaMCRenegociacao != undefined ? data[0].NrFolhaSolicitaMCRenegociacao : "";
    config.nomeResponsavel = data[0].usuarioResponsavel.nmResponsavel != undefined ? titleize(data[0].usuarioResponsavel.nmResponsavel) : "";

    if (config.codigoUnidadeGestora == "080101" || config.codigoUnidadeGestora == "080102" ||
    config.codigoUnidadeGestora == "080011" || config.codigoUnidadeGestora == "080104" ||
    config.codigoUnidadeGestora == "080259" || config.codigoUnidadeGestora == "080353" ||
    config.codigoUnidadeGestora == "080356" || config.codigoUnidadeGestora == "080357" ||
    config.codigoUnidadeGestora == "080358" || config.codigoUnidadeGestora == "080359" ||
    config.codigoUnidadeGestora == "080040" || config.codigoUnidadeGestora == "080360"
    ) {

        config.descricaoEnderecoNumero = "Endereço SEE : Praça da República, 53 - República, São Paulo/SP";
    }
    
    config.docGenerator = function (config) {
        var doc = {
            pageSize: "A4",
            pageOrientation: 'Portrait',
            title: "Encerramento Contratual",
            pageMargins: [30, 150, 50, 30],

            header: {
                margin: [0, 20, 0, 0],
                columns: [
                    {
                        image: "data:image/png;base64,",
                        width: 80,
                        height: 80,
                        margin: [40, 10, 20, 0],
                    },
                    [
                        { text: "GOVERNO DO ESTADO DE SÃO PAULO", alignment: "center", fontSize: 16, bold: true, margin: [0, 10, 40, 0], },
                        { text: "SECRETARIA DA EDUCAÇÃO", alignment: "center", fontSize: 14, bold: true, margin: [0, 0, 40, 0], },
                        { text: config.nomeUnidadeGestora, alignment: "center", fontSize: 12, bold: false, margin: [0, 0, 40, 0], },
                        { text: "\n\nINFORMAÇÃO DE ENCERRAMENTO CONTRATUAL POR NÃO RENEGOCIAÇÃO", alignment: "center", fontSize: 12, bold: false, margin: [0, 0, 40, 0], },
                    ],
                ],
            },

            content: {
                margin: [0, 20, 0, 0],
                columns: [
                    [
                        {
                            bold: true, fontSize: 13, margin: [20, 10, 40, 0], text: ["PROCESSO Nº : ",
                            { text: config.numeroProcesso, bold: false }, ]
                        },
                        {
                            bold: true, fontSize: 13, margin: [20, 0, 40, 0], text: ["CONTRATO Nº : ",
                            { text: config.NrContrato, bold: false }, ]
                        },
                        {
                            style: "destaque", text: ["ASSUNTO PLANEJADO: ",
                            { text: config.descricaoObjeto + "\n\n", style: "simples" }]
                        },
                        { text: "Tendo em vista a manifestação da Contratada às  fls. " + config.NrFolhaSolicitaMCRenegociacao + " , manifestando-se  contrária à renegociação dos valores do Contrato nº " + config.NrContrato + " , os quais se apresentaram superiores aos preços de mercado e/ou dos valores referenciais do CADTERC, conforme quadro comparativo de fls. " + config.nrFolha + ", informamos que o referido contrato terá sua vigência encerrada em " + config.dataVigenciaFim, alignment: "justify", fontSize: 12, bold: false, margin: [20, 0, 40, 0], },
                        { text: "Os créditos em nome da contratada,  referente  aos  serviços  prestados no  período  de " + config.dataVigenciaIni + "  a  " + config.dataVigenciaFim + " serão  quitados  de  acordo  com  a  Cláusula- " + config.DsClausulaContrato + "-Dos Pagamentos, do instrumento contratual.", alignment: "justify", fontSize: 12, bold: false, margin: [20, 0, 40, 0], },
                        { text: "Informamos ainda que foram tomadas as providências para nova contratação, de forma a garantir a prestação do serviço.\n\n\n\n\n", alignment: "justify", fontSize: 12, bold: false, margin: [20, 0, 40, 0], },

                        { text: config.descricaoMunicipio + ", " + config.DtImpressaodia + " de " + config.DtImpressaonomemes + " de " + config.DtImpressaoano + "\n\n\n\n\n\n", alignment: "right", fontSize: 12, bold: false, margin: [0, 0, 40, 0], },

                        { text: "____________________________________________________________________\n " + config.nomeGestor + "\n\n\n\n", alignment: "center", fontSize: 12, bold: false, margin: [0, 0, 40, 0], },

                    ],
                ],
            },
            footer:
         {
             margin: [20, 0, 0, 40],
             columns:
             [
                 {
                     style: "tabela",
                     table: {
                         widths: [100, 100, 240],
                         headerRows: 2,
                         fontSize: 9,
                         body: [
                                  [{ text: "Endereço UGE : " + config.descricaoEnderecoNumero, colSpan: 3, fontSize: 9, border: [false, true, false, false], bold: false, color: 'gray' }],
                                  [{ text: "                                                                                                                                                                           www.educacao.sp.gov.br", colSpan: 3, fontSize: 9, border: [false, false, false, false], bold: false, color: 'gray' }]
                         ]
                     },
                 },
             ],
         },

            styles: {
                destaque: {
                    fontSize: 13, bold: true,
                    margin: [20, 0, 40, 0],
                },
                tabela: {
                    margin: [20, 0, 40, 0], color: 'gray'
                },
                simples: {
                    fontSize: 13, bold: false,
                    margin: [20, 0, 0, 0],
                },
            },
        }
        return doc;    
    };
    sedPdfExporter.exportPdf(config);
}
